const TimePanel = props => {
    return (
        <>
            <section className="time-panel">
                <style jsx>{`
                    grid-area: time;
                    background-color: #DA523E;
                    border-radius: 10px;
                `}</style>
            </section>
            <section className="task-panel">
                <style jsx>{`
                    background-color: white;
                    grid-area: tasks;
                `}</style>
            </section>
        </>
    )
}

export default TimePanel;
